    meteorological, navigational, optical, physical and time series data logged by the
    Scientific Computer System (SCS) aboard NOAA Ship Oscar Dyson in the Bering Sea,
    Gulf of Alaska and North Pacific Ocean from 2015-06-11 to 2015-08-16. Office of
    Marine and Aviation Operations (OMAO) personnel aboard the ship submitted these
    data and associated metadata to NODC. In addition, NODC Accession 0130738 contains
    supplementary cruise-level metadata, which OMAO personnel logged in the Ship Daily
    Activity Log (SDAL). OMAO and NODC personnel developed the automated process to
